-- Check how many call logs exist
SELECT COUNT(*) as total_call_logs FROM callLogs;

-- Check call logs without leads (orphaned by conversion)
SELECT COUNT(*) as orphaned_call_logs FROM callLogs WHERE leadId IS NULL AND opportunityId IS NOT NULL;

-- Check if there are any leads left
SELECT COUNT(*) as remaining_leads FROM leads;

-- Check opportunities
SELECT COUNT(*) as total_opportunities FROM opportunities;

-- Sample some call logs to see their state
SELECT id, leadId, opportunityId, callOutcome, callDate FROM callLogs LIMIT 5;

